        2021</td>\n<td>72\n</td></tr></tbody></table>\n<h3><span class=\"mw-headline\"
        id=\"Annual_returns\">Annual returns</span><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=7\"
        title=\"Edit section: Annual returns\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\n<p>The
        following table shows the annual development of the Nasdaq-100 since 1985.<sup
        id=\"cite_ref-11\" class=\"reference\"><a href=\"#cite_note-11\">&#91;11&#93;</a></sup>\n</p>\n<table
